<?phpnamespace Nemundo\App\WebService\Reset;use Nemundo\App\WebService\Data\ServiceRequest\ServiceRequestDelete;use Nemundo\App\WebService\Data\ServiceRequest\ServiceRequestUpdate;use Nemundo\Project\Reset\AbstractReset;class WebServiceReset extends AbstractReset{    public function reset()    {        $update = new ServiceRequestUpdate();        $update->setupStatus = false;        $update->update();    }    public function remove()    {        $delete = new ServiceRequestDelete();        $delete->filter->andEqual($delete->model->setupStatus, false);        $delete->delete();    }}